import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
// import App from "./App";
import Nav from "./components/Nav";
import Product from "./components/Product";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    {/* <App /> */}
    <Nav />
    <Product />
  </React.StrictMode>
);

